// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

import "./MediTrack.sol";

contract PrimaryCare {
    //The owner of this contract will be the adminstration that oversees the "Integrated Delivery Network"

    address public owner;
    string public name;
    address public patientRecord;

    mapping(address => Patient) public patients;
    struct Patient {
        string name;
        address patient;
        address patientContract;
    }

    constructor(string memory _name) {
        owner = msg.sender;
        name = _name;
    }

    function addPatient(
        address patient,
        address patientContract,
        string memory name
    ) public {
        Patient memory patientToAdd = Patient(name, patient, patientContract);

        patients[patient] = patientToAdd;
    }

    function sendRecordRequest(
        address patient,
        address to,
        string memory toName,
        string memory toSpecial,
        string memory toEmail,
        address toContract
    ) public {
        MediTrack pp = MediTrack(patients[patient].patientContract);

        pp.addRequest(
            owner,
            name,
            "Primary Care Provider",
            "gupta.pediatrics@MediTrack.tech",
            to,
            toName,
            toSpecial,
            toEmail,
            toContract
        );
    }

    function getContractAddress() public returns (address) {
        return (patients[msg.sender].patientContract);
    }
}

// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

contract MediTrack {
    //The owner of this contract will be the adminstration that oversees the "Integrated Delivery Network"
    address public owner;
    address public primaryCareOrigin;
    address public primaryCareContract;
    string public name;
    uint256 public activeRequestCount = 0;
    mapping(uint256 => Request) public activeRequestsByInt;
    mapping(address => Request) public activeRequests;
    struct Request {
        address from;
        string fromName;
        string fromSpecial;
        string fromEmail;
        address to;
        string toName;
        string toSpecial;
        string toEmail;
        address toContract;
        bool verified;
    }

    constructor(
        string memory _name,
        address patientAddress,
        address pcc
    ) {
        owner = patientAddress;
        name = _name;
        primaryCareOrigin = msg.sender;
        primaryCareContract = pcc;
    }

    function addRequest(
        address from,
        string memory fromName,
        string memory fromSpecial,
        string memory fromEmail,
        address to,
        string memory toName,
        string memory toSpecial,
        string memory toEmail,
        address toContract
    ) public {
        require(
            msg.sender == primaryCareContract,
            "Only Primary Care Origin can add requests to MediTrack"
        );

        Request memory request = Request(
            from,
            fromName,
            fromSpecial,
            fromEmail,
            to,
            toName,
            toSpecial,
            toEmail,
            toContract,
            true
        );
        activeRequestsByInt[activeRequestCount] = request;
        activeRequestCount++;
    }

    function getactiveRequestCount() public view returns (uint256) {
        require(
            msg.sender == owner,
            "Only Patient-Owner of the contract has access"
        );
        return (activeRequestCount);
    }

    function getRequest(uint256 index) public view returns (Request memory) {
        require(
            msg.sender == owner,
            "Only Patient-Owner of the contract has access"
        );
        return activeRequestsByInt[index];
    }

    function updateActive(uint256 index) public {
        require(
            msg.sender == owner,
            "Only Patient-Owner of the contract has access"
        );
        activeRequestsByInt[index].verified = false;
    }
}

